import Grid from '@mui/material/Grid';

export default function GradioComponent() {
    return (
        <div className="gradio-component" style={{"alignItems": "center"}}>
            <Grid
                container
                direction="column"
                justifyContent="center"
                alignItems="center"
            >
            <iframe
                src="https://korhanerdem-fashion-fusion.hf.space"
                frameborder="0"
                style={{'width': '50%', 'height': '2500px'}}
            ></iframe>
            </Grid>
        </div>
    );
};
